The package family name is only included when it is likely to have been produced by Mozilla: it starts "Mozilla." or "MozillaCorporation.".
 */
WindowsPackageFamilyName("WindowsPackageFamilyName", "ping"),
/** Information on winsock LSPs injected in our networking stack.
 */
Winsock_LSP("Winsock_LSP", "report"),
/** If we crash while some code is spinning manually the event loop on the main thread, we will see the stack of nested annotations here. If the crashing process was killed (e.g. due to an IPC error), this annotation may refer to the parent process that killed it, look out for the prefix ("default" means parent) and see bug 1741131 for details.
 */
XPCOMSpinEventLoopStack("XPCOMSpinEventLoopStack", "report");

        public override fun toString() = s

        /** @return Whether the annotation should be included in crash pings. */
        public fun allowedInPing() = scope.equals("ping")

        /** @return Whether the annotation should be included in crash reports. */
        public fun allowedInReport() = allowedInPing() || scope.equals("report")
    }
}
